<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\RedBayOccupational;
use DB;
use Illuminate\Database\Seeder;

class RedBaySeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'Red Bay, AL')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Red Bay, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Red Bay Occupational Tax',
            'tax' => RedBayOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
